import * as React from 'react';
import Box from '@mui/material/Box';
import SpeedDial from '@mui/material/SpeedDial';
import SpeedDialAction from '@mui/material/SpeedDialAction';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import CheckIcon from '@mui/icons-material/Check';
import { Facebook, Instagram, Pinterest, Twitter } from 'react-bootstrap-icons';
import { palette } from '@mui/system';
import { NoSsr } from '@mui/material';
import { makeStyles } from '@mui/material';

const actions = [
  { icon: <Facebook />, name: 'Facebook' },
  { icon: <Instagram />, name: 'Instagram' },
  { icon: <Twitter />, name: 'Twitter' },
  { icon: <Pinterest />, name: 'Pinterest' },
];



export default function SpeedMenu() {
  return (
    <NoSsr>
    <Div color='gold' bgcolor='black'>
    <Box sx={{ height: 320, transform: 'translateZ(0px)', flexGrow: 1, bgcolor: 'text.primary' }}>
      <SpeedDial
        ariaLabel="SpeedDial openIcon example"
        sx={{ position: 'absolute', bottom: 16, right: 16 }}
        icon={<FavoriteBorderIcon openIcon={<CheckIcon />} />}
      >
        {actions.map((action) => (
          <SpeedDialAction
            key={action.name}
            icon={action.icon}
            tooltipTitle={action.name}
          />
        ))}
      </SpeedDial>
    </Box>
    </Div>
    </NoSsr>
  );
}
